  true,\n\t\"url\": null,\n\t\"notes\": \"The Small Business Administration maintains
  the Dynamic Small Business Search (DSBS) database. As a small business registers
  in the System for Award Management, there is an opportunity to fill out the small
  business profile. The information provided populates DSBS. DSBS is another tool
  contracting officers use to identify potential small business contractors for upcoming
  contracting opportunities. Small businesses can also use DSBS to identify other
  small businesses for teaming and joint venturing.\",\n\t\"license_title\": \"U.S.
